import React from 'react'

import './styles.css'
import logo from '../../assets/logo'

const CreatePoint = () => {
    return (
        <div id="page-create-point">
            <header>
                <img src={logo} alt=""/>
            </header>
        </div>
    )
    
}

export default CreatePoint
